contracts/Deck.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Deck {
    uint8[52] private deck;
    uint8 private deckIndex;

    constructor() {
        initializeDeck();
    }

    function initializeDeck() internal {
        for (uint8 i = 0; i < 52; i++) {
            deck[i] = i; // Store card as index (0-51)
        }
    }

    function shuffleDeck() external {
        for (uint8 i = 0; i < 52; i++) {
            uint8 n = uint8(uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, i))) % 52);
            (deck[i], deck[n]) = (deck[n], deck[i]); // Swap cards
        }
        deckIndex = 0;
    }

    function drawCard() external returns (uint8) {
        require(deckIndex < 52, "Deck is empty");
        return deck[deckIndex++];
    }

    function getCardDetails(uint8 cardIndex) external pure returns (uint8 rank, uint8 suit) {
        require(cardIndex < 52, "Invalid card index");
        rank = (cardIndex % 13) + 1; // 1-13 (Ace to King)
        suit = cardIndex / 13;       // 0-3 (Hearts, Diamonds, Clubs, Spades)
    }
}

