// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

library PokerHandEvaluator {
    // Enum for different hand ranks
    enum HandRank { HighCard, OnePair, TwoPair, ThreeOfAKind, Straight, Flush, FullHouse, FourOfAKind, StraightFlush, RoyalFlush }

    // Struct to store a hand (with rank and the highest card details)
    struct Hand {
        HandRank rank;
        uint8 highestCard;
    }

    // Function to evaluate the strength of a hand
    function evaluateHand(uint8[5] memory cards) public pure returns (Hand memory) {
        uint8[5] memory sortedCards = sortCards(cards);
        bool isFlush = isFlush(sortedCards);
        bool isStraight = isStraight(sortedCards);

        if (isStraight && isFlush) {
            if (sortedCards[0] == 10) {
                return Hand(HandRank.RoyalFlush, sortedCards[4]); // Royal Flush
            }
            return Hand(HandRank.StraightFlush, sortedCards[4]); // Straight Flush
        }

        uint8[13] memory cardCounts = countCards(sortedCards);
        if (cardCounts[12] == 4) return Hand(HandRank.FourOfAKind, getHighestRank(cardCounts, 4)); // Four of a Kind
        if (cardCounts[12] == 3 && cardCounts[0] >= 2) return Hand(HandRank.FullHouse, getHighestRank(cardCounts, 3)); // Full House
        if (isFlush) return Hand(HandRank.Flush, sortedCards[4]); // Flush
        if (isStraight) return Hand(HandRank.Straight, sortedCards[4]); // Straight
        if (cardCounts[12] == 3) return Hand(HandRank.ThreeOfAKind, getHighestRank(cardCounts, 3)); // Three of a Kind
        if (cardCounts[12] == 2 && cardCounts[0] == 2) return Hand(HandRank.TwoPair, getHighestRank(cardCounts, 2)); // Two Pair
        if (cardCounts[12] == 2) return Hand(HandRank.OnePair, getHighestRank(cardCounts, 2)); // One Pair

        return Hand(HandRank.HighCard, sortedCards[4]); // High Card
    }

    // Function to sort the cards in descending order
    function sortCards(uint8[5] memory cards) public pure returns (uint8[5] memory) {
        for (uint8 i = 0; i < cards.length; i++) {
            for (uint8 j = i + 1; j < cards.length; j++) {
                if (cards[i] < cards[j]) {
                    uint8 temp = cards[i];
                    cards[i] = cards[j];
                    cards[j] = temp;
                }
            }
        }
        return cards;
    }

    // Function to check if the hand is a flush (all cards of the same suit)
    function isFlush(uint8[5] memory cards) public pure returns (bool) {
        uint8 suit = cards[0] / 13;
        for (uint8 i = 1; i < cards.length; i++) {
            if (cards[i] / 13 != suit) {
                return false;
            }
        }
        return true;
    }

    // Function to check if the hand is a straight (five consecutive cards)
    function isStraight(uint8[5] memory cards) public pure returns (bool) {
        for (uint8 i = 1; i < cards.length; i++) {
            if (cards[i] != cards[i-1] - 1) {
                return false;
            }
        }
        return true;
    }

    // Function to count the occurrences of each card rank
    function countCards(uint8[5] memory cards) public pure returns (uint8[13] memory) {
        uint8[13] memory counts;
        for (uint8 i = 0; i < cards.length; i++) {
            counts[cards[i] % 13]++;
        }
        return counts;
    }

    // Function to get the highest card from a count of cards with a certain number of occurrences
    function getHighestRank(uint8[13] memory counts, uint8 occurrences) public pure returns (uint8) {
        for (int8 i = 12; i >= 0; i--) {  // Fixed loop index issue
            if (counts[uint8(i)] == occurrences) {
                return uint8(i);
            }
        }
        return 0;
    }

    // Function to compare two hands and return the stronger hand
    function compareHands(uint8[5] memory hand1, uint8[5] memory hand2) public pure returns (uint8) {
        Hand memory hand1Rank = evaluateHand(hand1);
        Hand memory hand2Rank = evaluateHand(hand2);

        if (hand1Rank.rank > hand2Rank.rank) return 1; // hand1 is better
        if (hand1Rank.rank < hand2Rank.rank) return 2; // hand2 is better

        // If the ranks are equal, compare the highest card
        if (hand1Rank.highestCard > hand2Rank.highestCard) return 1;
        if (hand1Rank.highestCard < hand2Rank.highestCard) return 2;

        return 0; // Tie (can be expanded for tie-breaking rules)
    }
}

