// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Deck.sol";
import "./PokerHandEvaluator.sol";

contract TexasHoldem {
    using PokerHandEvaluator for uint8[5];

    struct Player {
        address addr;
        uint256 betAmount;
        uint8[2] holeCards; // Store card indices instead of structs
        bool isActive;
    }

    Deck private deckContract;
    uint8[5] public communityCards;
    mapping(address => Player) public players;
    address[] public playerAddresses;
    uint256 public pot;
    bool public gameStarted;

    event GameStarted();
    event CardsDealt();
    event BetPlaced(address indexed player, uint256 amount);
    event WinnerDeclared(address indexed winner, uint256 winnings);

    modifier onlyActivePlayer() {
        require(players[msg.sender].isActive, "Not an active player");
        _;
    }

    constructor(address _deckContract) {
        deckContract = Deck(_deckContract);
    }

    function joinGame() external payable {
        require(!gameStarted, "Game already started");
        require(msg.value > 0, "Must place initial bet");
        require(players[msg.sender].addr == address(0), "Already joined");

        players[msg.sender] = Player(msg.sender, msg.value, [0, 0], true);
        playerAddresses.push(msg.sender);
        pot += msg.value;
    }

    function startGame() external {
        require(playerAddresses.length >= 2, "Not enough players");
        gameStarted = true;
        deckContract.shuffleDeck();
        emit GameStarted();
    }

    function dealCards() external {
        require(gameStarted, "Game has not started");

        for (uint8 i = 0; i < playerAddresses.length; i++) {
            players[playerAddresses[i]].holeCards = [deckContract.drawCard(), deckContract.drawCard()];
        }

        for (uint8 i = 0; i < 5; i++) {
            communityCards[i] = deckContract.drawCard();
        }

        emit CardsDealt();
    }

    function getHoleCards() external view onlyActivePlayer returns (uint8[2] memory, uint8[2] memory) {
        uint8[2] memory holeCards = players[msg.sender].holeCards;
        uint8[2] memory ranks;
        uint8[2] memory suits;
        for (uint8 i = 0; i < 2; i++) {
            (ranks[i], suits[i]) = deckContract.getCardDetails(holeCards[i]);
        }
        return (ranks, suits);
    }

    function getCommunityCards() external view returns (uint8[5] memory, uint8[5] memory) {
        uint8[5] memory ranks;
        uint8[5] memory suits;
        for (uint8 i = 0; i < 5; i++) {
            (ranks[i], suits[i]) = deckContract.getCardDetails(communityCards[i]);
        }
        return (ranks, suits);
    }

    function placeBet() external payable onlyActivePlayer {
        require(gameStarted, "Game has not started");
        require(msg.value > 0, "Bet must be greater than 0");

        players[msg.sender].betAmount += msg.value;
        pot += msg.value;

        emit BetPlaced(msg.sender, msg.value);
    }

    function declareWinner() external {
        require(gameStarted, "Game has not started");
        require(playerAddresses.length > 0, "No players in the game");

        uint8[5] memory playerHand;
        address winner = playerAddresses[0];
        PokerHandEvaluator.Hand memory bestHandRank = PokerHandEvaluator.Hand(PokerHandEvaluator.HandRank.HighCard, 0);

        // Evaluate the hands for each player
        for (uint8 i = 0; i < playerAddresses.length; i++) {
            Player memory player = players[playerAddresses[i]];

            // Combine hole cards and community cards into one array for evaluation
            for (uint8 j = 0; j < 2; j++) {
                playerHand[j] = player.holeCards[j];
            }
            for (uint8 j = 0; j < 5; j++) {
                playerHand[2 + j] = communityCards[j];
            }

            // Evaluate this player's hand
            PokerHandEvaluator.Hand memory currentHandRank = PokerHandEvaluator.evaluateHand(playerHand);

            // Compare hands
            if (currentHandRank.rank > bestHandRank.rank) {
                bestHandRank = currentHandRank;
                winner = player.addr;
            } else if (currentHandRank.rank == bestHandRank.rank) {
                // If hands are equal, compare highest card
                if (currentHandRank.highestCard > bestHandRank.highestCard) {
                    bestHandRank = currentHandRank;
                    winner = player.addr;
                }
            }
        }

        // Transfer the pot to the winner
        payable(winner).transfer(pot);
        emit WinnerDeclared(winner, pot);

        resetGame();
    }

    function resetGame() internal {
        for (uint8 i = 0; i < playerAddresses.length; i++) {
            players[playerAddresses[i]].isActive = false;
        }
        delete playerAddresses;
        gameStarted = false;
        pot = 0;
    }
}

